import Link from 'next/link';

// Style
import { Container } from './styles';

const Menu = () => {
	return (
		<Container>
			<Link href="/">Store</Link>
			<Link>Library</Link>
			<Link>Community</Link>
			<Link>Support</Link>
		</Container>
	);
};

export default Menu;
